import React, {useState} from 'react'

const form = props => {

    const [formState] = useState ({
        form_info: [
            {first: ' '},
            {last: ' '},
            {Address: ' '},
            {State: ' '},
            {County: ' '},
            {Zipcode: ' '}

        ],
    })

    return (
        <div>
            <h1>Full Name={formState.fo}</h1>
            <h1>Full Name</h1>
            <h1>Full Name</h1>
            <h1>Full Name</h1>
            <h1>Full Name</h1>
            <h1>Full Name</h1>
        </div>
    )



}
export default form;
